import React from "react";
import { NavLink } from "react-router-dom";

const Card = (props) => {
  return (
    <>
      <div className="col-md-4 col-12 ">
        <div className="card w-100 h-100">
          <div className="card-img">
            <img
              src={props.imgsrc}
              class="card-img-top"
              alt={props.imgsrc}
              width="200x"
              height="190px"
            />
          </div>
          <div className="header">
            
          </div>
        </div>
      </div>
    </>
  );
};

export default Card;
